// Welcome.js
import React from 'react';
import { useNavigate } from 'react-router-dom';

const Welcome = () => {
    const navigate = useNavigate();

    return (
        <div className="welcome-container min-h-screen flex flex-col items-center justify-center bg-gradient-to-r from-blue-400 to-blue-500">
            <h1 className="text-5xl font-bold text-white mb-10 animate-bounce-3d">
                Welcome to <span className="text-shadow-lg">CareLink</span>!
            </h1>
            <div className="flex space-x-6">
                <button
                    onClick={() => navigate('/labtest')}
                    className="px-6 py-3 bg-white text-blue-500 font-semibold rounded-lg shadow-3d transition transform hover:scale-105 hover:bg-blue-100"
                >
                    Lab Test
                </button>
                <button
                    onClick={() => navigate('/chatbot')}
                    className="px-6 py-3 bg-white text-blue-500 font-semibold rounded-lg shadow-3d transition transform hover:scale-105 hover:bg-blue-100"
                >
                    Chatbot
                </button>
            </div>
        </div>
    );
};

export default Welcome;
